        const URL = "https://dummyapi.io/data/v1/user?limit=10";
    (async()=> {
        const {data} = (await axios.get(URL, {
            headers:{"app-id":"6450dca9caedebc0caec21a1"}})).data;
            setUsers(data);
    })()

},[])

return (
    <div>
    {users.map(user => {
        return <div>{user.firstName} {user.lastName}</div>
    })}
    </div>
)
}

